import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

<FontAwesomeIcon icon="fa-brands fa-github" />
function Footer() {
    const icons = [
        {
            name: 'fa-brands fa-github',
            links: 'https://github.com/cfriedman2156',
        },
        {
            name: 'linkedin',
            links: 'https://www.linkedin.com/in/chase-friedman-a20372133/',
        },
        {
            name: 'instagram',
            links: 'https://www.instagram.com/chaseunfiltered/?hl=en',
        },
        {
            name: 'tiktok',
            links: '',
        }
    ]

    return (
        <footer>
            {icons.map(icon => {
                return <a href={icon.link} key={icon.name} target='_blank'><i className={icon.name}></i></a>
            })}
        </footer>
    )
}


export default Footer;
